description:
The qualified candidate must have:
A Bachelor's Degree or equivalent work experience in IT and/or business administration. Finance accountancy/ finance degree preferable;
Five plus (5+) years of Project/Financial Analyst experience in complex projects with direct support responsibilities to project/program manager(s);
Experience supporting the management of project financials (budget, forecast, variance) of at least $1M;
Experience working within Health Authorities;
Analytical skills including the ability to comprehend, analyze, and resolve complex issues and present information in concise meaningful ways;
Demonstrated ability to use database, spreadsheet and word processing software at an advanced level. MS Office Suite products, particularly MS PowerPoint and MS Excel (Knowledge with Macros/Pivot tables, SUM_IF, IF_THEN, VLOOKUP);
Working knowledge of projects and various reporting/analytical tools;
Demonstrated understanding of the Project Delivery Life Cycle;
Experience working in a project environment involving PMO and multiple stakeholder(s);
The ability to work effectively as part of a team;
The ability to work independently with minimal supervision;
Highly developed business writing and verbal communication skills with the ability to document work appropriately, including executive briefing notes;
Demonstrated ability to exercise tact, good judgment, and initiative; and,
Mainstream project management software/tools experience preferred.
